lv_img_dsc_t book1;

void lv_book1_init(){
    lv_img_header_t header;
    book1.header = header;
    header.cf = LV_IMG_CF_TRUE_COLOR;
    header.always_zero = 0;
    header.reserved = 0;
    header.w = 53;
    header.h = 80;

    book1.data_size = 4240 * LV_COLOR_SIZE / 8;
    book1.data = book1_map;
}

void img_btn_book::img_btn_book1(lv_obj_t *parent) {
    lv_book1_init();
    /*Init the pressed style*/
    static lv_style_t style_pr;//Apply for a style
    lv_style_init(&style_pr);  //Initialize it
    lv_style_set_translate_y(&style_pr, 5);//Style: Every time you trigger, move down 5 pixels

    /*Create an image button*/
    lv_obj_t *imgbtn1 = lv_imgbtn_create(parent);    //Apply for a picture button
    lv_obj_add_style(imgbtn1, &style_pr, LV_STATE_PRESSED);//Triggered when the button is pressed

    lv_obj_set_size(imgbtn1, 80, 80);               //Sets the size of the picture button
    lv_obj_align(imgbtn1, LV_ALIGN_CENTER, 0, 0);   //Set the position of the picture button
    lv_imgbtn_set_src(imgbtn1, LV_IMGBTN_STATE_RELEASED, NULL, &book1, NULL);

    /*Create a label on the image button*/
    lv_obj_t *label = lv_label_create(parent);
    lv_label_set_text(label, "Libro 1");
    lv_obj_align_to(label, imgbtn1, LV_ALIGN_OUT_BOTTOM_MID, 0, 20);
}